import { Container, AppBar, Typography, Grow, Grid } from '@material-ui/core';

const App = () => {
    return (
        <Container maxidth="lg">
            <AppBar position = "static" color ="inherit">
                <Typography variant="h2" align="center">MeetSync</Typography>
                <img src={meetsync} alt="meetsync" height="60" />
            </AppBar>
        </Container>
    )
}

export default App;
